// import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div>
      <body>
        <h1>Hello, this is your extension!</h1>
        <button id="myButton">Click me</button>
        <script type="module" src="background.js"></script>
      </body>
    </div>
  );
}

export default App;
